def minPath(grid, k):
    n = len(grid)
    visited = set()
    queue = [(0, 0, 0, [grid[0][0]])]

    while queue:
        row, col, step, path = queue.pop(0)

        if (row, col, step) in visited:
            continue

        visited.add((row, col, step))

        if step == k:
            return path

        for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            new_row, new_col = row + dr, col + dc

            if 0 <= new_row < n and 0 <= new_col < n:
                new_path = path + [grid[new_row][new_col]]
                queue.append((new_row, new_col, step + 1, new_path))

    return []

